---------------------------------------------------------------------------------------------------------
-- Table: CITIES
---------------------------------------------------------------------------------------------------------

CREATE TABLE LOC.CITIES (
	ID		 INT NOT NULL,		      -- identificador unico de cidade
	CITY_NAME	 VARCHAR2(250) NOT NULL,      -- Name of cities
	STATE_ID	 INT NOT NULL,		      -- foreign staties
	STATE_LOCAL_CODE INT                          -- identifier code provided by federal agencies of each country. 
);

-- CONSTRAINTS

ALTER TABLE LOC.CITIES
	ADD CONSTRAINT PK001_CITIES PRIMARY KEY (ID);
	
ALTER TABLE LOC.CITIES
	ADD CONSTRAINT FK001_CITIES_TO_STATIES FOREIGN KEY (STATE_ID) REFERENCES LOC.STATIES (ID);


-- SEQUENCES.

CREATE SEQUENCE SQ001_ID MINVALUE 1 MAXVALUE 999999999999999999999999999 START WITH 1 INCREMENT BY 1 CACHE 20;

